-- initial data sets for sparrow_recsys running with mysql.

CREATE TABLE `sparrow_recsys`.`movies` (
  `movieId` BIGINT(20) NOT NULL,
  `title` VARCHAR(100) NULL,
  `genres` VARCHAR(200) NULL,
  PRIMARY KEY (`movieId`));


CREATE TABLE `sparrow_recsys`.`ratings` (
  `userId` BIGINT(20) NOT NULL,
  `movieId` BIGINT(20) NOT NULL,
  `rating` FLOAT NULL,
  `timestamp` BIGINT(20) NULL,
  PRIMARY KEY (`userId`, `movieId`));


